// src/components/stagiaire/ListStagiaire.js
import React from 'react';
import { useSelector } from 'react-redux';
import Stagiaire from './Stagiaire';

const ListStagiaire = () => {
  const stagiaires = useSelector((state) => state);

  return (
    <div className="container" style={{ marginTop: '20px', display: 'flex', flexDirection: 'row' }}>
      {stagiaires.map((stagiaire, key) => (
        <Stagiaire key={key} image={stagiaire.image} nom={stagiaire.nom} />
      ))}
    </div>
  );
};

export default ListStagiaire;
